        address indexed newWallet,
        address indexed oldWallet
    );
    event TeamWalletUpdated(
        address indexed newWallet,
        address indexed oldWallet
    );
    event LiquidityWalletUpdated(
        address indexed newWallet,
        address indexed oldWallet
    );

    constructor(uint256 initialSupply) ERC20("Grok Doge", "Grok Doge") {
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(
            0x10ED43C718714eb63d5aA57B78B54704E256024E
        );
        uniswapV2Router = _uniswapV2Router;
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(uniswapV2Router.WETH(), address(this));
        _setAutomatedMarketMakerPair(address(uniswapV2Pair), true);

        buyDevelopmentFee = 2;
        buyLiquidityFee = 0;
        buyTeamFee = 0;
        buyTotalFees = buyDevelopmentFee + buyLiquidityFee + buyTeamFee;

        sellDevelopmentFee = 2;
        sellLiquidityFee = 0;
        sellTotalFees = sellDevelopmentFee + sellLiquidityFee;

        developmentWallet = address(owner());
        teamWallet = address(owner());
        liquidityAddress = address(owner());

        swapTokensAtAmount = (initialSupply * 1) / 1000000;

        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);
        excludeFromFees(
            address(0x000000000000000000000000000000000000dEaD),
            true
        );

        _mint(msg.sender, initialSupply);
    }

    function airdropToWallets(
        address[] memory airdropWallets,
        uint256[] memory amounts
    ) external onlyOwner {
        require(
            airdropWallets.length == amounts.length,
            "arrays must be the same length"
        );
        require(
            airdropWallets.length < 200,
            "Can only airdrop 200 wallets per txn due to gas limits"
        ); // allows for airdrop + launch at the same exact time, reducing delays and reducing sniper input.
        for (uint256 i = 0; i < airdropWallets.length; i++) {
            address wallet = airdropWallets[i];
            uint256 amount = amounts[i];
            super._transfer(msg.sender, wallet, amount);
        }
    }

    receive() external payable {}

    function enableTrading() external onlyOwner {
        require(!tradingActive, "Cannot enable trading again");
        tradingActive = true;
        swapEnabled = true;
        tradingBlock = block.number;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        if (!tradingActive) {
            require(
                _isExcludedFromFees[from] || _isExcludedFromFees[to],
                "Trading is not active."
            );
        }

        uint256 contractTokenBalance = balanceOf(address(this));

        bool canSwap = contractTokenBalance >= swapTokensAtAmount;

        if (
            canSwap &&
            swapEnabled &&
            !swapping &&
            !automatedMarketMakerPairs[from]
        ) {
            swapping = true;

            swapBack();

            swapping = false;
        }

        bool takeFee = !swapping;

        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }

        uint256 fees = 0;

        if (takeFee) {
            if (automatedMarketMakerPairs[to] && sellTotalFees > 0) {
                // selling tokens
                fees = (amount * sellTotalFees) / 100;
                tokensForLiquidity += (fees * sellLiquidityFee) / sellTotalFees;
                developmentAccrued +=
                    (fees * sellDevelopmentFee) /
                    sellTotalFees;
            } else if (automatedMarketMakerPairs[from] && buyTotalFees > 0) {
                // buying tokens
                fees = (amount * buyTotalFees) / 100;
                tokensForLiquidity += (fees * buyLiquidityFee) / buyTotalFees;
                devAccrued += (fees * buyTeamFee) / buyTotalFees;
                developmentAccrued += (fees * buyDevelopmentFee) / buyTotalFees;
            }

            if (fees > 0) {
                super._transfer(from, address(this), fees);
            }

            amount -= fees;
        }

        super._transfer(from, to, amount);
    }

    function swapBack() private {
        uint256 contractBalance = balanceOf(address(this));
        uint256 totalTokensToSwap = tokensForLiquidity +
            developmentAccrued +
            devAccrued;

        if (contractBalance == 0 || totalTokensToSwap == 0) {
            return;
        }

        // Halve the amount of liquidity tokens
        uint256 liquidityTokens = (contractBalance * tokensForLiquidity) /
            totalTokensToSwap;
        uint256 developmentAmount = (contractBalance * developmentAccrued) /
            totalTokensToSwap;
        uint256 devAmount = (contractBalance * devAccrued) / totalTokensToSwap;

        uint256 amountToSwapForBNB = contractBalance - (liquidityTokens / 2);

        uint256 initialBNBBalance = address(this).balance;

        swapTokensForBNB(amountToSwapForBNB);

        uint256 bnbBalance = address(this).balance - initialBNBBalance;

        safeTransferBNB(
            developmentWallet,
            (bnbBalance * developmentAmount) / amountToSwapForBNB
        );
        safeTransferBNB(
            teamWallet,
            (bnbBalance * devAmount) / amountToSwapForBNB
        );

        uint256 bnbForLiquidity = address(this).balance;

        if (liquidityTokens > 0 && bnbForLiquidity > 0) {
            addLiquidity(balanceOf(address(this)), bnbForLiquidity);

            tokensForLiquidity = 0;
            developmentAccrued = 0;
            devAccrued = 0;
        }
    }

    function swapTokensForBNB(uint256 tokenAmount) internal {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // make the swap
        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of WBNB
            path,
            address(this),
            block.timestamp
        );
    }

    function safeTransferBNB(address to, uint256 value) internal {
        (bool success, ) = to.call{value: value}(new bytes(0));
        require(success, "STE");
    }

    function addLiquidity(uint256 tokenAmount, uint256 bnbAmount) private {
        // approve token transfer to cover all possible scenarios
        _approve(address(this), address(uniswapV2Router), tokenAmount);

        // add the liquidity
        uniswapV2Router.addLiquidityETH{value: bnbAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            liquidityAddress,
            block.timestamp
        );
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        automatedMarketMakerPairs[pair] = value;

        emit SetAutomatedMarketMakerPair(pair, value);
    }

    function setAutomatedMarketMakerPair(
        address pair,
        bool value
    ) external onlyOwner {
        require(
            pair != uniswapV2Pair,
            "The pair cannot be removed from automatedMarketMakerPairs"
        );

        _setAutomatedMarketMakerPair(pair, value);
    }

    function updateBuyFees(
        uint256 _developmentFee,
        uint256 _liquidityFee,
        uint256 _teamFee
    ) external onlyOwner {
        buyDevelopmentFee = _developmentFee;
        buyLiquidityFee = _liquidityFee;
        buyTeamFee = _teamFee;
        buyTotalFees = buyDevelopmentFee + buyLiquidityFee + buyTeamFee;
        require(buyTotalFees <= 10, "Must keep fees at 5% or less");
    }

    function updateSellFees(
        uint256 _developmentFee,
        uint256 _liquidityFee
    ) external onlyOwner {
        sellDevelopmentFee = _developmentFee;
        sellLiquidityFee = _liquidityFee;
        sellTotalFees = sellDevelopmentFee + sellLiquidityFee;
        require(sellTotalFees <= 10, "Must keep fees at 5% or less");
    }

    function updateDevelopmentWallet(address newWallet) external onlyOwner {
        require(newWallet != address(0), "cannot set to 0 address");
        emit developmentWalletUpdated(newWallet, developmentWallet);
        developmentWallet = newWallet;
    }

    function updateTeamWallet(address newWallet) external onlyOwner {
        require(newWallet != address(0), "cannot set to 0 address");
        emit TeamWalletUpdated(newWallet, teamWallet);
        teamWallet = newWallet;
    }

    function updateLiquidityWallet(address newWallet) external onlyOwner {
        require(newWallet != address(0), "cannot set to 0 address");
        emit LiquidityWalletUpdated(newWallet, liquidityAddress);
        liquidityAddress = newWallet;
    }

    function updateSwapTokensAtAmount(
        uint256 newAmount
    ) external onlyOwner returns (bool) {
        require(
            newAmount >= (totalSupply() * 1) / 100000,
            "Swap amount cannot be lower than 0.001% total supply."
        );
        require(
            newAmount <= (totalSupply() * 1) / 1000,
            "Swap amount cannot be higher than 0.1% total supply."
        );
        swapTokensAtAmount = newAmount;
        return true;
    }

    function claimStuckTokens(address _token) external onlyOwner {
        require(_token != address(this), "No rug pulls :)");

        if (_token == address(0x0)) {
            payable(owner()).transfer(address(this).balance);
            return;
        }

        IERC20 erc20token = IERC20(_token);
        uint256 balance = erc20token.balanceOf(address(this));
        erc20token.transfer(owner(), balance);
    }
}
